function getZeroByTenthOf(num) {
  return Math.random() * 10 <= num ? 0 : 1; // Generating 0 with probability of num/10
}

function createMaze(m, n) {
  let maze = [];
  for (let i = 0; i < m; i++) {
    let row = [];
    for (let j = 0; j < n; j++) {
      row.push(getZeroByTenthOf(7));
    }
    maze.push(row);
  }
  return maze;
}

function Square({num}) {
  return <button className="square">{num}</button>
}

export default function Board() {
  let maze = createMaze(4, 4);

  return (
    <div>
      {maze.map((_, line) => (
        <div key={_}>
          {maze[line].map((num) => (
            <Square num={num} />
          ))}
        </div>
      ))}
    </div>
  );
}
